  true,\n\t\"url\": null,\n\t\"notes\": \"<p>This page provides background needed
  to take advantage of the capabilities of the MSIS Drug Utilization Datamart. This
  mart allows the user to develop high-level statistical tables covering Medicaid
  drug utilization for groups of drugs. This mart does not present data for each National
  Drug Code (NDC) but summarizes drug payments and claim counts using the MEDISPAN
  drug groupings developed by Wolters Kluwer Health,  Inc.</p>n\",\n\t\"license_title\":
